    for i in range(len(sequence)):
        if sequence[i] == '4':
            transformed_sequence += '0'
        elif sequence[i] == '0':
            transformed_sequence += '9'
        else:
            transformed_sequence += str(11 - int(sequence[i]))
    return transformed_sequence.
